import React, { Component } from "react";
import 'bootstrap/dist/css/bootstrap.min.css';
import 'bootstrap/dist/js/bootstrap';
// about fnt icon
// import { FaUser,FaHistory,FaMedium,FaBurn, FaLock, FaBook, FaBlog,FaDelicious } from "react-icons/fa";


//service icon 
import { FaCode,FaMobile,FaTools,FaAccusoft,FaMap,FaCogs,FaDice } from "react-icons/fa";

// techonlogies font icon
import { FaPython,FaPhp,FaDumpster,FaAngular,FaReact } from "react-icons/fa";
import { FaAndroid,FaApple,FaReacteurope,FaPhabricator,FaSleigh } from "react-icons/fa";

// digital marketing icon
import { FaSearchengin,FaSmog,FaPoll,FaSnowflake,FaInbox,FaAdn } from "react-icons/fa";
import Header from "./Style/Header";


// import 'react-bootstrap/dist/react-bootstrap';

export default class Navbar extends Component {

  render() {
    return (
      <fragments className="hed-ing">
          <Header />
     {/*------------------- top nvbar -------------------------*/}
      <div className="top-nav-bar">
        <div className="search-box">
            <input type="text" class="form-control" />
            <span className="input-group-text"><i class="fas fa-search"></i></span>
        </div>

        <div class="menu-bar">
            <ul>
                <li>
                  <a href="/">Home</a>
                </li>
                <li>
                  <a href="/">AboutUs</a>
                </li>
                <li>
                  <a href="/">Services</a>
                </li>

                <li>
                    <a href="/">Technology</a>
                </li>

                <li>
                    <a href="/"><i class="fas fa-user-plus nav-logo"></i>SignUp</a>
                </li>

                <li>
                    <a href="/"><i class="fas fa-sign-in-alt nav-logo"></i>Log In</a>
                </li>
            </ul>
        </div>

    </div>
    {/*---------------------end top navbar--------------------- */}
                    <section className="hero">
                            <div className="container">
                              <div className="row">
                                <div className="had">
                                  <h3 className="had-item">Mobile App Testing on 100+ Real Devices</h3>
                                  <h1 className="had-item">Welcome to the New World : <span className="text-warning"> Mobile First</span></h1>
                                  <h6 className="had-item">A one-stop destination for all your app testing and QA needs!</h6>
                                  <button className="btn btn-warning btn-md text-white had-btn">Get start now</button>
                                </div>
                              </div>
                            </div>

                </section>
      </fragments>
    );
  }
}
